import React from 'react'
import FormInput from '../FormInput/FormInput';

class SignIn extends React.Component {
    constructor(props) {
        super(props)

        this.state = {
            email: '',
            password: ''
        }

    }

    handelSubmit = event => {
        event.preventDefault();
        this.setState({ email: '', password: '' })
    }

    handelChange = event => {
        const { value, name } = event.target;
        this.setState({ [name]: value })


    }


    render() {

        return (
            <div className='sign-in'>
                <h2>I already have an account</h2>
                <span> sign in with your email and password</span>
                <form onSubmit={this.handelSubmit}>
                    <FormInput name='email'  label="email" value={this.state.email} handelChange={this.handelChange} required />
                  

                    <FormInput name='password' handelChange={this.handelChange}  label="password" value={this.state.password} required />
              
                    <input type="submit" value="submit form" handelChange={this.handelChange} />

                </form>


            </div>
        )
    }
}


export default SignIn
